import useGet from "./server_fetch/useGet";

const DisplayBlog = () => {
  const { data, error, isPending } = useGet(
    "http://localhost:8000/get_all_blogs"
  );
  if (data) {
    console.log(data.allData[1].b_author);
    return <div>Doen</div>;
  } else {
    {
      true && (
        <button disabled>
          <div className="lds-spinner">
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
          </div>
        </button>
      );
    }
    {
      error && <div>Something Wrong Try Again Later</div>;
    }
  }
  if (isPending) {
    return <div>Fetching Data Wait</div>;
  }
  if (error) {
    return <div>Home</div>;
  } else {
    return <div>Sorry Try Again Later</div>;
  }
};

export default DisplayBlog;
